import React from "react";
import { Link, useLocation } from "react-router-dom";

export default function Navbar() {
  const loc = useLocation();

  return (
    <nav className="nav">
      <div className="brand">My Portfolio</div>
      <div className="links">
        <Link className={loc.pathname === "/" ? "active" : ""} to="/">
          Home
        </Link>
        <Link className={loc.pathname === "/projects" ? "active" : ""} to="/projects">
          Projects
        </Link>
        <Link className={loc.pathname === "/resume" ? "active" : ""} to="/resume">
          Resume
        </Link>
        <Link className={loc.pathname === "/contact" ? "active" : ""} to="/contact">
          Contact
        </Link>
      </div>
    </nav>
  );
}
